import React from "react";
import MenuIcon from '@mui/icons-material/Menu';   
import "../componentsHeader/cart.css"

const Cart = () =>{
    return (
        <>
        <label for="check"><MenuIcon id="menuIcon"> </MenuIcon></label>
        <input type="checkbox" id="check"/>
        </>
    )
}

export default Cart
